import  './ss.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Navbar } from "./components/navbar";
import   Shop   from "./pages/shop/shop";
// import { Contact } from "./pages/contact";
import { Cart } from "./pages/cart/cart";
// import  Sidebar  from './back/Sidebar';
import Sidenavbar from './back/sidenavbar';
import FileUpload from './back/Fileupload';
// import Sidehome from './back/Sidehome';
import { Option }  from './pages/option';
import  { Login }  from './pages/login/login'
import   Signup  from './pages/login/signup';
import Qpay from './card/qpay';
import { ShopContextProvider } from "./context/shop-context";
import Card from './card/card';
import Home from './Home';
import Admin from './Admin';
import Sidecart  from './back/sidecart';



function App() {
  return (
    <div className="App">
      <ShopContextProvider>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/" element={<Shop />} />
            <Route path="/cart" element={<Cart />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/card" element={<Card />} />
            <Route path="/home" element={<Home />} />
            <Route path="/qpay" element={<Qpay />} />
            <Route path="/sidenavbar" element={<Sidenavbar/>} />
            {/* <Route path="/sidebar" element={<Sidebar />} /> */}
            <Route path="/sidecart" element={<Sidecart />} />
            {/* <Route path="/sidehome" element={<Sidehome />} /> */}
            <Route path="/admin" element={<Admin />} />
            <Route path="/fileupload" element={<FileUpload />} />
            <Route path="/option" element={<Option />} />
          </Routes>
        </Router>
      </ShopContextProvider>
    </div>
  );
}

export default App;
